function toTitleCase(str) {
    return str.replace(/\w\S*/g, function(txt) {
        return txt.charAt(0).toUpperCase() + txt.substr(1).toLowerCase();
    });
}

function appendResult(element, name) {

    element.innerHTML += "Working...";

    if ((name.match(/\s+/g) || []).length > 1) {
        name = nameExtractor(name);
    }
    var params = new FormData();
    params.append("profname", name);
    var tempName = toTitleCase(name);
    if (tempName in profs) {
        var name = "<p>" + text["name"] + "</p>";
        var grade = "<p>Rating: " + text["rating"] + "</p>";
        var url = "<a target=\"_blank\" href=\"https://www.ratemyprofessors.com\"" + text["link"] + ">RateMyProfessor Link</a>";
        console.log(name + grade + url);
        element.innerHTML = name + grade + url;
        localParse(profs[tempName])
    } else {
        var url = "https://students.washington.edu/joshj004/php/handler.php";
        var ajax = new XMLHttpRequest();
        ajax.open("POST", url, true);
        ajax.send(params);
        ajax.onreadystatechange = function() {
            if (ajax.readyState == 4) {
                formatter(element, ajax.responseText);
            } else {
                document.getElementById("info").innerHTML = name + " Was Not Found";
            }
        }
    }
}

function nameExtractor(name) {
    var names = name.split(" ");
    return names[0] + " " + names[names.length - 1];
}

function formatter(element, text) {
    if (text == "") {
        element.innerHTML = element.innerHTML.substring(0, element.innerHTML.length - 10);
        element.innerHTML += "Professor not found on RateMyProfessor";
    } else {
        var text = JSON.parse(text);
        if (text["formatted_name"] == null || text["overall_grade"] == null || text["url"] == null) {
            element.innerHTML = element.innerHTML.substring(0, element.innerHTML.length - 10);
            element.innerHTML += "Professor not found on RateMyProfessor";
        } else {
            var name = "<p>" + text["formatted_name"] + "</p>";
            var grade = "<p>Rating: " + text["overall_grade"] + "</p>";
            var url = "<a target=\"_blank\" href=" + text["url"] + ">RateMyProfessor Link</a>";
            console.log(name + grade + url);
            element.innerHTML = name + grade + url;
        }
    }
}
